import React from 'react';
import {View,
        Text,
        TouchableOpacity,
        StyleSheet,
        Dimensions } from 'react-native';


const InitialScreen= () => {
    return(
        <View>
            <View style={styles.mainComponent}>
                <TouchableOpacity //Button for Sign-In button
                    onPress={() => {}}
                    style={{alignItems: 'center',
                            justifyContent: 'center'}}
                >
                     <View style = {styles.viewComponent}>
                        <Text style = {styles.textComponent}>Sign-In</Text>
                    </View>
                </TouchableOpacity>

        <TouchableOpacity //Button for Log-In Button
            onPress={() => {}}
            style={{alignItems: 'center',
                    justifyContent: 'center',
                    marginTop: 10}}
        >
            <View style = {styles.viewComponent}
            >
                <Text style = {styles.textComponent}>Log-In</Text>
            </View>
        </TouchableOpacity>
    </View>
        </View>
    );
}

const styles = StyleSheet.create({
    viewComponent: {
        backgroundColor: '#16a596', 
        alignItems: 'center', 
        justifyContent: 'center', 
        borderRadius: 100,
        width: (Dimensions.get('window').width)*(0.5),
        height: 50
    },
    textComponent: {
        color: 'black',
        fontWeight: 'bold',
        fontSize: 20
    },
    mainComponent : {
        marginTop: (Dimensions.get('window').height)*(0.40)
    }
});
export default InitialScreen;
